import React from 'react';
import ChatItem from './ChatItem';

const ChatSection = () => {
  const chatItems = [
    {
      title: "Strategy Documents",
      tag: "Ellaments",
      tagColor: "bg-green-100 text-green-800",
      timeAgo: "9d ago",
      updated: "Updated: 05/13/2025 @ 4:15pm"
    },
    {
      title: "Social Media Campaign Planning for Nostal...",
      tag: "Project A",
      tagColor: "bg-blue-100 text-blue-800",
      timeAgo: "9d ago",
      updated: "Updated: 05/13/2025 @ 4:15pm"
    },
    {
      title: "Nurture Email Sequence Development for T...",
      tag: "Project A",
      tagColor: "bg-blue-100 text-blue-800",
      timeAgo: "9d ago",
      updated: "Updated: 05/13/2025 @ 4:15pm"
    },
    {
      title: "Social Media Post Strategy and Content De...",
      tag: "Project A",
      tagColor: "bg-blue-100 text-blue-800",
      timeAgo: "9d ago",
      updated: "Updated: 05/13/2025 @ 4:15pm"
    }
  ];

  return (
    <div className="px-4 flex-1 overflow-y-auto">
      {/* Section Header */}
      <div className="flex items-center justify-between mb-4 px-3" style={{width: '300.99px'}}>
        <div className="flex items-center gap-2">
          <div className="w-5 h-5 text-ella-blue mt-0.5">
            <svg fill="currentColor" viewBox="0 0 24 24">
              <path d="M20 2H4c-1.1 0-2 .9-2 2v12c0 1.1.9 2 2 2h4l4 4 4-4h4c1.1 0 2-.9 2-2V4c0-1.1-.9-2-2-2z"/>
            </svg>
          </div>
          <span className="font-semibold text-ella-text font-geist leading-6" style={{width: '104px'}}>Recent Chats</span>
        </div>
        <button className="w-5 h-5 text-gray-400 hover:text-gray-600 mt-0.5">
          <svg fill="currentColor" viewBox="0 0 24 24">
            <path fillRule="evenodd" d="M5.293 7.293a1 1 0 011.414 0L10 10.586l3.293-3.293a1 1 0 111.414 1.414l-4 4a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414z" clipRule="evenodd" />
          </svg>
        </button>
      </div>

      {/* Chat Items */}
      <div className="flex flex-col items-end" style={{width: '312.99px'}}>
        {chatItems.map((item, index) => (
          <div key={index} className={`flex justify-end ${index > 0 ? 'mt-0.5' : ''}`} style={{width: '312.99px', minHeight: '49px'}}>
            <div style={{width: '272.99px'}}>
              <ChatItem {...item} />
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ChatSection;
